import React from 'react';
import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Projects from './components/Projects/ProjectUI';
import Particles from 'react-particles-js';
import particlesConfig from './Particles/configParticles';
import { Scrollbars } from 'react-custom-scrollbars';

function App() {
  return (
    <div className="App" >
      <Scrollbars width='100%'>
      <Particles height="100vh" width="100vw" className='particles' params={particlesConfig} />
      <Projects />
    </Scrollbars>
  </div>
  );
}

export default App;
